import Navbar from "./navbar";


const AddBook = () => {
    return ( 
        <div className="addBook">
            <Navbar/>
            <div className="box">
            <div className="title">
                <h1>Library Management</h1>
            </div>
            <div className="forms">
                <form action="">
                    <h1>Title</h1>
                    <input type="text" placeholder="Enter the title"/>

                    <h1>Page Count</h1>
                    <input type="number" placeholder="Enter  the page count"/>

                    <h1>Aut</h1>
                </form>
            </div>
            </div>

        </div>
        
     );
}
 
export default AddBook;
